import React from 'react'
import Todo from './Todo'
export default function TodoList({allEvents, toggleTodo}) {
    const handleTodo =()=>{
     allEvents.filter(events=>events.holiday ='No')
        }
        
    
    return (
        allEvents.map(allEvents =>{
           return <Todo key={allEvents.id}  allEvents={handleTodo()} toggleTodo={toggleTodo}/>
        })
      
    )
    
}
